import { useCallback, useEffect, useState } from "react";

export function GetUrl() {
  const [facebookRepos, setFacebookRepos] = useState([]);
  const getData = async () => {
    let url = "https://api.github.com/users/facebook/repos";
    let response = await fetch(url);
    let makeJson = await response.json();
    setFacebookRepos(makeJson);
  };

  useEffect(async () => {
    getData();
  }, []);
  //   console.log(facebookRepos);
  if (facebookRepos.map((elem) => elem.node_id).length ==0){
      return <div></div>
  }
  else 
  facebookRepos.map((elem) => <div>{elem.node_id}</div>)
}
